import { StyleSheet } from "react-native"

const styles = StyleSheet.create({
    formContext: {
        width: "100%",
        height:"100%",
        bottom:0,
        backgroundColor: "#ffffff",
        alignItems:"center",
        borderTopLeftRadius:30,
        borderTopRightRadius:30,
        marginTop:30,

    },
    form: {
        width:"100%",
        height:"auto",
        color:"#ff0065",
        fontSize: 24,
        fontWeight:"bold",

    }


});

export default styles
